import React from "react";
import "../Styles/Navbar.css";
import logo from "../img/-.png";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <nav>
      <a href="">
        <img src={logo} alt="" />
      </a>
      <div className="menu-icon">
        <ul>
          <li>Inicio</li>
          <li>Sobre m√≠</li>
          <li>Proyectos</li>
          <li>Habilidades</li>
          <li>Contacto</li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
